import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import { Link } from "react-router-dom";

export default function NavigationBar() {
  return (
    <AppBar position="static" color="default" elevation={1} sx={{ backgroundColor: "#fff" }}>
      <Toolbar
        sx={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          flexWrap: "wrap",
          paddingX: 2,
        }}
      >
        {/* Logo Centered */}
        <Box
          component={Link}
          to="/new"
          sx={{
            textDecoration: "none",
            color: "inherit",
            position: "absolute",
            top: "16px",
            left: "50%",
            transform: "translateX(-50%)",
          }}
        >
          <Typography
            variant="h5"
            sx={{
              fontWeight: "bold",
              textTransform: "uppercase",
              display: "flex",
              alignItems: "center",
              gap: "8px",
            }}
          >
            <Box
              sx={{
                width: 40,
                height: 40,
                backgroundColor: "#ccc",
                borderRadius: "50%",
              }}
            />
            Logo Placeholder
          </Typography>
        </Box>

        {/* Navigation Links */}
        <Box
          sx={{
            display: "flex",
            flexGrow: 1,
            justifyContent: "space-between",
            paddingTop: "40px", // Adjust spacing from the logo
          }}
        >
          <Button
            component={Link}
            to="/venues"
            color="inherit"
            sx={{ textTransform: "uppercase", fontSize: "14px" }}
          >
            Venues
          </Button>
          <Button
            component={Link}
            to="/hair"
            color="inherit"
            sx={{ textTransform: "uppercase", fontSize: "14px" }}
          >
            Hair
          </Button>
          <Button
            component={Link}
            to="/makeup"
            color="inherit"
            sx={{ textTransform: "uppercase", fontSize: "14px" }}
          >
            Makeup
          </Button>
          <Button
            component={Link}
            to="/photographers"
            color="inherit"
            sx={{ textTransform: "uppercase", fontSize: "14px" }}
          >
            Photographers
          </Button>
          <Button
            component={Link}
            to="/music"
            color="inherit"
            sx={{ textTransform: "uppercase", fontSize: "14px" }}
          >
            Music
          </Button>
        </Box>

        {/* Shopping Cart Icon */}
        <IconButton
          component={Link}
          to="/cart"
          color="inherit"
          sx={{
            position: "absolute",
            top: "16px",
            right: "24px",
          }}
        >
          <ShoppingCartIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
